  const prices = [
    "0-$50",
    "$50-$100",
    "$100-$1000",
    "Above $1000",
    "Accessories",
  ];
  return (
    <>
      <Typography
        variant="h4"
        color="secondary"
        fontWeight="bold"
        marginTop="20px"
      >
        Product Price
      </Typography>
      <RaadioGr
        aria-labelledby="demo-radio-buttons-group-label"
        defaultValue={0}
        name="radio-buttons-group"
      >
        {
            prices.map(price =>{
                return<FormControlLabel value={price} control={<Radio/>} label={price}/>

            })
        }
      </RaadioGr>
    </>
  );
};

export default PriceRadio;
